import React from "react";


interface PostFormProps {
    userId?: string,
    title?: string,
    body?: string
}

export class PostForm extends React.Component<PostFormProps> {

    render () {

        return (
            <div>
                <h1> Submit a request to Reserve space </h1> 
                <form>
                    <div>
                        <label> UserID </label>
                        <input type='text' id='UID' name='userId' value={this.props.userId}/>
                    </div>
                    <div>
                        <input type='text' name='title'/>
                    </div>
                    <div>
                        <input type='text' name='body'/>
                    </div>
                </form>

            </div>
        )
        console.log(this.props.userId);
    }
}

export default PostForm;
